/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 "ADAABECONDEBANC"
 "ABCN"
 */
var minWindow = function(s, t) {
  if(s === t) return s;
  const l = s.length, tl = t.length, diff = l - tl, tMap = {}, wMap = {};
  let left = -1, right, lm = -1, rm = -1, count = 0;

  t.split('').forEach(el => tMap[el] = (tMap[el] || 0) + 1);
  
  while(!tMap[s[++left]] && left < l);
  right = left;
  do {
    let sR = s[right];
    if(tMap[sR]) {
      wMap[sR] = (wMap[sR] || 0) + 1;
      if(tMap[sR] >= wMap[sR]) count++;
      if(count === tl) {
        if(rm === -1 || right - left < rm - lm) {
          rm = right;
          lm = left;
        }
        wMap[s[left]]--;
        if(wMap[s[left]] < tMap[s[left]]) count--;
        do {
          while(!tMap[s[++left]] && left < l);
          let sL = s[left];
          if(tMap[sL] < wMap[sL]) {
            wMap[sL]--;
            continue;
          }
          if(count === tl) {
            if(right - left < rm - lm) {
              rm = right;
              lm = left;
            }
            wMap[sL]--;
            count--;
            continue;
          }
          break;
        } while(left < l);
      }
    }
    right++;
  } while(right < l && left < l);
  if(rm > -1) return s.substring(lm, rm + 1);
  return '';
};
minWindow("aba", "aa");
return;
minWindow(
  "",
  ""
);